The default way to write a test suite is to use individual it() statements for each test. // test/palindrome.test.ts
describe('isPalindrome - Form 0', () => { it('isPalindrome("Racecar") => true', () => { expect(isPalindrome('Racecar')).toEqual(true); }); it('isPalindrome("Typewriter") => false', () => { expect(isPalindrome('Typewriter')).toEqual(false); }); it('isPalindrome("rotor") =>', () => { expect(isPalindrome('rotor')).toEqual(true); });
}); This certainly works, but it violates the DRY principle - Don't Repeat Yourself. We can do better!

