You can specify a test data suite as an "Array of Arrays" if you like, where each inner array is equal to one test data set. Example: // test/palindrome.test.ts
describe('isPalindrome - Form 1', () => { it.each([ ['Racecar', true], ['TypeWriter', false], ['rotor', true], ])('isPalindrome("%s") => %s', (testWord, expectedResult) => { expect(isPalindrome(testWord)).toEqual(expectedResult); });
}); This gives us a few nice qualities, and has some downsides. Firstly, we write the test code once, and yet it runs multiple times! We also can inject the parameter values from the test into the test name (using %s formatting)! It also means that adding more test cases is as easy as adding a new line to the array. Unfortunately, it has the downside of not really labelling the parameters. If you're not so familiar with JS, it might not be obvious that 'Racecar' is being inserted as testWord, but that's not a huge deal. We do have another option:

