Tagged Template literals is a concept in JS of using the backtick characters (`) to format strings. In this case we get to create a testing table as below: // test/palindrome.test.ts
describe('isPalindrome - Form 2', () => { it.each` testWord | expectedResult ${'Racecar'} | ${true} ${'TypeWriter'} | ${false} ${'rotor'} | ${true} `('isPalindrome("$testWord") => $expectedResult', ({ testWord, expectedResult }) => { expect(isPalindrome(testWord)).toEqual(expectedResult); });
}); Note the differences between this and Form 1 it.each([])('', ()={}) is now called like it.each``('', () => {}) The parameters in the test name are now labelled, instead of using %s The arguments to the test are now using ({ testWord, expectedResult }) => {} instead of (testWord, expectedResult) => {} The columns have labels! Test values are wrapped in ${} . This is required, even for string arguments. If you're using ES Lint and Prettier, it will even clean up the table formatting for you, so all of your columns are well aligned! The final advantage is that the column order doesn't have to follow the argument order in the test parameters - the column names just have to match. ie: the following will also work! describe('isPalindrome - Form 2', () => { it.each` expectedResult | testWord ${true} | ${'Racecar'} ${false} | ${'TypeWriter'} ${true} | ${'rotor'} `('isPalindrome("$testWord") => $expectedResult', ({ testWord, expectedResult }) => { expect(isPalindrome(testWord)).toEqual(expectedResult); });
}); In any case, the results will give you tests that print out like this when you run them: Using it.each() may not be applicable for all test input data, for example if sometimes the test should throw an Error.
